import {ReactComponent as ProfileIcon} from 'assets/img/profile.svg';
import './styles.css'

function Navbar() {
    return (
        <header>
            <nav className="container">
                <div className="market-nav-content">
                    <h1>Marketplace</h1>  
                    <a href="">
                        <div className="market-contact-container">
                            <ProfileIcon />
                            <p className="market-contact-link">Perfil</p>
                        </div>
                    </a>          
                </div>
            </nav>
        </header>
    );
}

export default Navbar;
